import sys

input_ = """

""".strip()


def _react(a, b):
    return a != b and a.upper() == b.upper()


def part1(inp):
    polymer = list(inp)
    i = 0

    while True:
        try:
            polymer[i+1]
        except IndexError:
            break

        if _react(*polymer[i:i+2]):
            del polymer[i:i+2]
            i = max(0, i-1)
        else:
            i += 1

    return len(polymer)


def part2(inp):
    shortest = sys.maxsize

    for letter in set(l.lower() for l in inp):
        length = part1(l for l in inp if l.upper() != letter.upper())
        shortest = min(shortest, length)

    return shortest


print(part1(input_))
print(part2(input_))
